import React from "react";
import s from './MyPost.module.css'
import Post from "./Post/Post";

const MyPost = () => {
    return (
        <div>
            <div className={s.item}>
                My posts
                <div/>
                <Post />
                </div>
        </div>
    )
}
export default MyPost
